import React from 'react';

import { Typography, Grid, Avatar, Box } from "@material-ui/core";
import avatar from "../profilePhoto.jpg";

const Header = () => {
    return (
        <Box>
            <Avatar src={avatar} alt="Deepika Sathianarayanan"/>
            

        </Box>
    )
}

export default Header
